'use strict';

// MODULES //

var tape = require( 'tape' );
var isObjectArray = require( '@stdlib/utils/is-object' ).isObjectArray;
var data = require( './../lib' );


// TESTS //

tape( 'main export is an array of objects', function test( t ) {
	t.ok( true, __filename );
	t.equal( isObjectArray( data ), true, 'main export is an array of objects' );
	t.end();
});
